import { Redirect } from 'react-router-dom'
import axios from 'axios';
import API from '../utils/API'

const MyRecipes = props =>{

	useEffect(()=>{
		API.myRecipes()
		.then(results=>{
			results
		})
	},[])

	handleChange =({target}) => {
		const {name, value} = target; 
		this.setState({ [name]: value});
	}

	
	
	return(
		<>
			test
		</>
	)
}

export default MyRecipes
